import React from 'react';
import { SafeAreaView, Text } from 'react-native';


export default function Information() {
  return (
    <SafeAreaView>
        <View>
          <Text>Hey,</Text>
          <Text>Login Now.</Text>
        </View>
        <View>
          <Text></Text>
        </View>
    </SafeAreaView>
  );
}
